class Survey extends React.Component {

    state = {
        percentage: 99,
      };

increase = () => {

    this.setState({percentage: this.state.percentage + 1})
}

      render() {
        return (
          <div className="text-center"> 
          <div>
              {this.state.percentage}
          </div>
          <button onClick={this.increase}>NO!</button>
          </div>
        );
      }
}

export default Survey;
